
    <!DOCTYPE html>
    <html lang="en">
    <head>
    <meta charset="UTF-8">
    <title>Demographics Report</title>
    <style>
        body {
            font-family: Arial, sans-serif;
            margin: 20px;
            overflow: auto;
        }
        h1 {
            text-align: center;
        }
        .container {
            display: grid;
            grid-template-columns: repeat(4, 1fr);
            gap: 20px;
            overflow: auto;
        }
        .card {
            text-align: center;
        }
        .zoom-container {
            overflow: auto;
            max-height: 400px;
            max-width: 100%;
            border: 1px solid #ccc;
            border-radius: 8px;
            padding: 5px;
        }
        .zoom-container img {
            width: 100%;
            transition: transform 0.3s ease;
        }
        .zoom-container:hover img {
            transform: scale(1.5);
            cursor: zoom-in;
        }
        .caption {
            margin-top: 10px;
            font-weight: bold;
        }
        @media (max-width: 800px) {
            .container {
                grid-template-columns: repeat(2, 1fr);
            }
        }
        @media (max-width: 500px) {
            .container {
                grid-template-columns: 1fr;
            }
        }
    </style>
    </head>
